class FacilityListMerger:
    def __init__(self, cost_component, info_components):
        self.cost_component = cost_component  # List of cost component lists (3D list)
        self.info_components = info_components  # List of info components

    def merge_lists(self):
        merged_result = []

        for info, first_level_list in zip(self.info_components, self.cost_component):
            merged_first_level = []
            for second_level_list in first_level_list:
                merged_second_level = self._merge_second_level_list(second_level_list, info)
                merged_first_level.append(merged_second_level)
            merged_result.append(merged_first_level)

        return merged_result

    def _merge_second_level_list(self, second_level_list, info):
        if not second_level_list:
            return []
        
        merged_list = second_level_list[0]
        for component in second_level_list[1:]:
            merged_list = [x + y for x, y in zip(merged_list, component)]

        return merged_list

